import React, { useEffect, useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
} from "recharts";

const Dashboard = () => {
  const [stats, setStats] = useState({
    properties: 0,
    units: 0,
    tenants: 0,
    agents: 0,
  });

  const [chartData, setChartData] = useState([]);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const [propertiesRes, unitsRes, tenantsRes, agentsRes, paymentsRes] =
          await Promise.all([
            fetch("http://localhost:5000/properties"),
            fetch("http://localhost:5000/units"),
            fetch("http://localhost:5000/tenants"),
            fetch("http://localhost:5000/agents"),
            fetch("http://localhost:5000/payments"),
          ]);

        const [properties, units, tenants, agents, payments] =
          await Promise.all([
            propertiesRes.json(),
            unitsRes.json(),
            tenantsRes.json(),
            agentsRes.json(),
            paymentsRes.json(),
          ]);

        setStats({
          properties: properties.length,
          units: units.length,
          tenants: tenants.length,
          agents: agents.length,
        });

        // Example: convert payments into monthly totals
        const monthlyData = payments.reduce((acc, p) => {
          const month = new Date(p.date).toLocaleString("default", {
            month: "short",
          });
          if (!acc[month]) acc[month] = 0;
          acc[month] += p.amount;
          return acc;
        }, {});

        const chartArray = Object.keys(monthlyData).map((month) => ({
          month,
          payments: monthlyData[month],
        }));

        setChartData(chartArray);
      } catch (error) {
        console.error("Error fetching stats:", error);
      }
    };

    fetchStats();
  }, []);

  return (
    <div style={{ padding: "2rem" }}>
      <h2 style={{ marginBottom: "1.5rem", fontSize: "1.8rem", fontWeight: "bold" }}>
        Dashboard
      </h2>

      {/* Stat cards */}
      <div style={{ display: "grid", gridTemplateColumns: "repeat(4, 1fr)", gap: "1rem" }}>
        <div style={cardStyle}>
          <h3>Properties</h3>
          <p style={numberStyle}>{stats.properties}</p>
        </div>
        <div style={cardStyle}>
          <h3>Units</h3>
          <p style={numberStyle}>{stats.units}</p>
        </div>
        <div style={cardStyle}>
          <h3>Tenants</h3>
          <p style={numberStyle}>{stats.tenants}</p>
        </div>
        <div style={cardStyle}>
          <h3>Agents</h3>
          <p style={numberStyle}>{stats.agents}</p>
        </div>
      </div>

      {/* Line chart */}
      <div style={{ marginTop: "2rem", background: "#fff", padding: "1rem", borderRadius: "8px", boxShadow: "0 0 8px rgba(0,0,0,0.1)" }}>
        <h3 style={{ marginBottom: "1rem" }}>Monthly Payments</h3>
        <ResponsiveContainer width="100%" height={300}>
          <LineChart data={chartData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="month" />
            <YAxis />
            <Tooltip />
            <Line type="monotone" dataKey="payments" stroke="#8884d8" strokeWidth={2} />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
};

const cardStyle = {
  backgroundColor: "#fff",
  borderRadius: "8px",
  padding: "1.5rem",
  boxShadow: "0 0 8px rgba(0,0,0,0.1)",
  textAlign: "center",
};

const numberStyle = {
  fontSize: "2rem",
  fontWeight: "bold",
  marginTop: "0.5rem",
};

export default Dashboard;
